import React from 'react';
import c from './Dialogs.module.css';


const Dialogs = (props) => {

    const Message = (props) => {
        return (
            <div className={c.dialog}>{props.msg}</div>
        );
    }


    let dialogs = [
        { id: 1, name: 'Danon' },
        { id: 2, name: 'Vanon' },
        { id: 3, name: 'Vlad' },
        { id: 4, name: 'Vitalya' }
    ]



    const DialogItem = (props) => {
        return (
            <div>
                {props.name}
            </div>
        )
    }

    let dialogElements = dialogs.map((dialog) => <DialogItem name={dialog.name} id={dialog.id} />);


    return (
        <div className={c.dialogs}>
            <div className={c.dialogs_item}>
                {dialogElements}
            </div>
            <div></div>
            <div>
                <Message msg='Если не веришь что черные куры несут черные яйца' />
                <Message msg='Тогда загугли: BIG BlACK COCK' />
            </div>
        </div>
    );
}

export default Dialogs;
